# shortest path.py
# using breadth-first search
# here we go

class Solution:

    def shortestPathBinaryMatrix(self, grid):

        if grid[0][0] == 1:
            return -1
        if grid[-1][-1] == 1:
            return -1

        visited = [[False for col in row] for row in grid]
        values_map = [[ 1 for col in row] for row in grid]

        visited[0][0] = True
        
        queue = [(0,0)]
        current_val = 1
        
        while len(queue):
            parent = queue.pop(0)
            i = parent[0]
            j = parent[1]
            val = values_map[i][j]

            self.get_neighbors(grid, visited, i, j, queue, val, values_map)

            if i == len(grid)-1 and j == len(grid[0])-1:
                return values_map[i][j]
        return -1
    

    def get_neighbors(self, grid, visited, row, col, neighbors, val, values_map):

        upper, right, left, lower = 0, len(grid[0]), 0, len(grid)
        
        # can go down
        if row + 1 < lower:
            if grid[row+1][col] != 1 and not visited[row+1][col]:
                neighbors.append((row+1, col))
                values_map[row+1][col] += val
                visited[row+1][col] = True
        # can go right
        if col + 1 < right:
            if grid[row][col+1] != 1 and not visited[row][col+1]:
                neighbors.append((row, col+1))
                values_map[row][col+1] += val
                visited[row][col+1] = True
        # can go left
        if col - 1 >= left:
            if grid[row][col-1] != 1 and not visited[row][col-1]:
                neighbors.append((row, col-1))
                values_map[row][col-1] += val
                visited[row][col-1] = True
        # can go up
        if row - 1 >= upper:
            if grid[row-1][col] != 1 and not visited[row-1][col]:
                neighbors.append((row-1, col))
                values_map[row-1][col] += val
                visited[row-1][col] = True
                
        # can go down+right
        if row + 1 < lower and col + 1 < right:
            if grid[row+1][col+1] != 1 and not visited[row+1][col+1]:
                neighbors.append((row+1, col+1))
                values_map[row+1][col+1] += val
                visited[row+1][col+1] = True
        # can go down-left
        if row + 1 < lower and col - 1 >= left:
             if grid[row+1][col-1] != 1 and not visited[row+1][col-1]:
                neighbors.append((row+1, col-1))
                values_map[row+1][col-1] += val
                visited[row+1][col-1] = True
        # can go up-left
        if row - 1 >= upper and col - 1 >= left:
            if grid[row-1][col-1] != 1 and not visited[row-1][col-1]:
                neighbors.append((row-1, col-1))
                values_map[row-1][col-1] += val
                visited[row-1][col-1] = True
        # can go up-right
        if row - 1 >= upper and col + 1 < right:
            if grid[row-1][col+1] != 1 and not visited[row-1][col+1]:
                neighbors.append((row-1, col+1))
                values_map[row-1][col+1] += val
                visited[row-1][col+1] = True
        
        return neighbors
    
